const e=JSON.parse('{"key":"v-0e77baf2","path":"/posts/database/mysql/mysql_mvcc.html","title":"mysql MVCC机制详解","lang":"zh-CN","frontmatter":{"category":["Mysql"],"description":"mysql MVCC机制详解 MVCC, 是Multi Version Concurrency Control的缩写，其含义是多版本并发控制。这一概念的提出是为了诗的MySQL可以实现RC隔离级别和RR隔离级别。 这里回顾一下MySQL的隔离级别和各种隔离级别所存在的问题。 MySQL的四种隔离级别如下： 读未提交（read uncommitted）：指一个事务还没有提交时，它做的变更才能被其他事务看到； 读提交(read committed)，指一个事务提交之后，它所做的变更才能被其他事务看到 可重复度（repeated read），指一个事务执行过程中看到的数据，一直跟这个事务启动时看到的数据时一致的，这是MySQL InnoDB引擎的默认隔离级别。 串行化(serializable)：会对记录加上读写锁，在多个事务对这条记录进行读写操作时，如果发生了读写冲突的时候，后访问的事务必须等前一个事务执行完成，才能继续执行","head":[["meta",{"property":"og:url","content":"https://mister-hope.github.io/posts/database/mysql/mysql_mvcc.html"}],["meta",{"property":"og:site_name","content":"Code Building"}],["meta",{"property":"og:title","content":"mysql MVCC机制详解"}],["meta",{"property":"og:description","content":"mysql MVCC机制详解 MVCC, 是Multi Version Concurrency Control的缩写，其含义是多版本并发控制。这一概念的提出是为了诗的MySQL可以实现RC隔离级别和RR隔离级别。 这里回顾一下MySQL的隔离级别和各种隔离级别所存在的问题。 MySQL的四种隔离级别如下： 读未提交（read uncommitted）：指一个事务还没有提交时，它做的变更才能被其他事务看到； 读提交(read committed)，指一个事务提交之后，它所做的变更才能被其他事务看到 可重复度（repeated read），指一个事务执行过程中看到的数据，一直跟这个事务启动时看到的数据时一致的，这是MySQL InnoDB引擎的默认隔离级别。 串行化(serializable)：会对记录加上读写锁，在多个事务对这条记录进行读写操作时，如果发生了读写冲突的时候，后访问的事务必须等前一个事务执行完成，才能继续执行"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-11-13T10:08:40.000Z"}],["meta",{"property":"article:modified_time","content":"2023-11-13T10:08:40.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"mysql MVCC机制详解\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2023-11-13T10:08:40.000Z\\",\\"author\\":[]}"]]},"headers":[],"git":{"createdTime":1697788089000,"updatedTime":1699870120000,"contributors":[{"name":"zgjsxx","email":"119160524@qq.com","commits":4}]},"readingTime":{"minutes":1.74,"words":521},"filePathRelative":"posts/database/mysql/mysql_mvcc.md","localizedDate":"2023年10月20日","excerpt":"<h1> mysql MVCC机制详解</h1>\\n<p>MVCC, 是Multi Version Concurrency Control的缩写，其含义是<strong>多版本并发控制</strong>。这一概念的提出是为了诗的MySQL可以实现RC隔离级别和RR隔离级别。</p>\\n<p>这里回顾一下MySQL的隔离级别和各种隔离级别所存在的问题。</p>\\n<p>MySQL的四种隔离级别如下：</p>\\n<ul>\\n<li>读未提交（read uncommitted）：指一个事务还没有提交时，它做的变更才能被其他事务看到；</li>\\n<li>读提交(read committed)，指一个事务提交之后，它所做的变更才能被其他事务看到</li>\\n<li>可重复度（repeated read），指一个事务执行过程中看到的数据，一直跟这个事务启动时看到的数据时一致的，这是MySQL InnoDB引擎的默认隔离级别。</li>\\n<li>串行化(serializable)：会对记录加上读写锁，在多个事务对这条记录进行读写操作时，如果发生了读写冲突的时候，后访问的事务必须等前一个事务执行完成，才能继续执行</li>\\n</ul>","autoDesc":true}');export{e as data};
